javascript:(function(){ var old_img_src="",find_count=0;document.querySelectorAll(".inventory_page > .itemHolder > .item").forEach(e=>{if(e.querySelector("img")){var r=e.querySelector("img").src;r==old_img_src?(e.style.background="#fcff4a",find_count+=1):old_img_src=r}}),alert("[Mane] Find Same object "+find_count.toString()+" items"); })();